Here's an example of an onSubmit function that sends form data to a GraphQL API using Apollo Client in a React component:

```jsx
import React, { useState } from 'react';
import { useMutation, gql } from '@apollo/client';
import { useForm } from 'react-hook-form';
import { useHistory } from 'react-router-dom';

// Define the GraphQL mutation
const SUBMIT_FORM_MUTATION = gql`
  mutation SubmitForm($input: FormInputType!) {
    submitForm(input: $input) {
      id
      name
      email
      // Add other fields as needed
    }
  }
`;

const MyForm = () => {
  const history = useHistory();
  const { register, handleSubmit } = useForm();
  const [submitForm, { loading }] = useMutation(SUBMIT_FORM_MUTATION);

  const onSubmit = async (data) => {
    try {
      const result = await submitForm({ variables: { input: data } });
      console.log(result);
      history.push('/success'); // Redirect to success page
    } catch (error) {
      console.error(error);
    }
  };

  return (
    <form onSubmit={handleSubmit(onSubmit)}>
      <input type="text" {...register('name')} placeholder="Name" />
      <input type="email" {...register('email')} placeholder="Email" />
      {/* Add other form fields as needed */}
      <button type="submit" disabled={loading}>
        Submit
      </button>
    </form>
  );
};

export default MyForm;
```

In this example, we define a GraphQL mutation `SUBMIT_FORM_MUTATION` that takes an input object with the form data. We use the `useMutation` hook from Apollo Client to execute the mutation and handle the loading state. We also use the `useForm` hook from `react-hook-form` to manage the form state and handle the form submission.

When the form is submitted, the `onSubmit` function is called, which sends the form data to the GraphQL API using the `submitForm` mutation. If the mutation is successful, we redirect the user to a success page. If there's an error, we log the error.

