In C programming, there are three types of variables: local variables, static variables, and global variables.

1. Local Variables: These are declared within a function and are only accessible within that function. They are created and destroyed each time the function is called.

2. Global Variables: These are declared outside of any function and are accessible from any part of the program. They are created when the program starts and destroyed when the program ends.

3. Static Variables: These are a combination of local and global variables. They are declared within a function like local variables, but they are not created and destroyed each time the function is called. Instead, they retain their value between function calls. If a static variable is declared outside of any function, it behaves like a global variable with a limited scope (only accessible within the file it is declared).

In terms of storage, local variables are stored on the stack, while static variables are stored in the data segment of the program's memory. Register variables are a special type of variable that are stored in the CPU's register instead of the memory. They are used for high-speed computation, but their use is limited because they can only hold a small amount of data and are not accessible from other functions.

Here is an example of using static variables:

```c
#include <stdio.h>

void counter() {
    static int count = 0; // static variable
    count++;
    printf("Count: %d\n", count);
}

int main() {
    counter();
    counter();
    counter();

    return 0;
}
```

