1. Constant Folding: This optimization technique replaces a constant expression with its value. For example, in the following code, the constant expression `2 + 3` is replaced with the constant value `5` during compilation.

```c
#include <stdio.h>

int main() {
    int a = 2 + 3;
    printf("The value of a is: %d\n", a);
    return 0;
}
```

2. Dead Code Elimination: This optimization technique removes code that is unreachable or never used. For example, in the following code, the variable `b` is never used, so it can be removed during compilation.

```c
#include <stdio.h>

int main() {
    int a = 10;
    int b = a * 2; // This line can be removed as b is never used
    printf("The value of a is: %d\n", a);
    return 0;
}
```

3. Common Subexpression Elimination (CSE): This optimization technique eliminates redundant computations of the same expression. For example, in the following code, the expression `a * b` is computed twice. By storing the result of the first computation and reusing it, the second computation can be avoided.

```c
#include <stdio.h>

int main() {
    int a = 3;
    int b = 4;
    int c = a * b;
    int d = a * b; // This line can be replaced with c
    printf("The value of c and d are the same: %d\n", c);
    return 0;
}
```

