Here's a solution for your problem using TypedArray and bitwise operations:

```javascript
function packEntities(entities) {
  const buffer = new Uint16Array(Math.ceil(entities.length / 2));

  let offset = 0;
  for (let i = 0; i < entities.length; i++) {
    const entity = entities[i];
    const id = entity.id & 0xF; // masking to get the 4 least significant bits
    const size = (entity.id >> 4) & 0x7; // shifting and masking to get the 3 middle bits

    buffer[offset++] = (id << 13) | (size << 9); // packing id and size into a single 16-bit value
  }

  return buffer.buffer;
}

function unpackEntities(buffer, length) {
  const entities = [];
  let offset = 0;

  while (offset < buffer.byteLength && offset < length) {
    const value = new Uint16Array(buffer, offset, 1)[0];
    const id = (value >> 13) & 0xF; // masking to get the 4 least significant bits
    const size = (value >> 9) & 0x7; // shifting and masking to get the 3 middle bits

    entities.push({ id, size });
    offset += 2; // moving to the next 16-bit value
  }

  return entities;
}
```

In the `packEntities` function, we create a Uint16Array to store the packed data. We then loop through the entities, pack each one into a 16-bit value, and store it in the array.

In the `unpackEntities` function, we loop through the buffer, unpack each 16-bit value, and create an entity object with the id and size fields. We also take a `length` parameter to limit the number of entities unpacked if the buffer is larger than necessary.

