import Service from '@ember/service';
import { inject as service } from '@ember/service';
import { A } from '@ember/array';
import { read } from 'csv-parser';
import { promisify } from 'util';
import { isEmpty } from '@ember/utils';

const readFile = promisify(require('fs').readFile);

export default Service.extend({
  store: service(),

  async downloadCSV(file) {
    const worker = new Worker('/assets/csv-worker.js');

    worker.onmessage = ({ data }) => {
      if (data.type === 'error') {
        console.error(data.message);
      } else if (data.type === 'records') {
        this.get('store').pushPayload(data.records);
      }
    };

    await readFile(file.path, 'utf8')
      .then((data) => worker.postMessage({ type: 'data', data }))
      .catch((error) => worker.postMessage({ type: 'error', message: error.message }));

    worker.terminate();
  },

  async fetchCSVRecords(modelName) {
    const records = A([]);

    if (!isEmpty(this.get('store').peekAll(modelName))) {
      records.pushObjects(this.get('store').peekAll(modelName));
    } else {
      await this.downloadCSV(this.get('store').adapterFor(modelName).buildURL({ filter: {} }));
      records.pushObjects(this.get('store').peekAll(modelName));
    }

    return records;
  },
});
