const _ = require('lodash');

function compareFiles(file1, file2, sheetName) {
  const workbook1 = XLSX.readFile(file1);
  const workbook2 = XLSX.readFile(file2);

  const sheet1 = workbook1.Sheets[sheetName];
  const sheet2 = workbook2.Sheets[sheetName];

  const keys1 = _.keys(sheet1);
  const keys2 = _.keys(sheet2);

  const differences = [];

  keys1.forEach((key1) => {
    const value1 = sheet1[key1].v;
    const key2 = _.findIndex(keys2, (key) => _.startsWith(key, key1)) + 1;

    if (key2 === -1) {
      differences.push(`Missing key "${key1}" in file 2`);
    } else {
      const value2 = sheet2[keys2[key2]].v;
      if (value1 !== value2) {
        differences.push(`Key "${key1}" has different values: "${value1}" (file 1) vs "${value2}" (file 2)`);
      }
    }
  });

  keys2.forEach((key) => {
    if (!_.includes(keys1, key)) {
      differences.push(`Extra key "${key}" in file 2`);
    }
  });

  console.log(differences.join('\n'));
}

